                  &quot;Three Ducks of the Condor&quot;



Part 3 of 5. 



An expert examines a coin from the sunken ship and declares it is from the legendary Valley of the Golden Suns. Scrooge flies to the Andes mountains to find the owner of a twin coin, and one half of the map leading to the Valley. He is aided by his nephew Donald, on temporary leave from the Navy, and pilot Launchpad McQuack.



